  \"2016-07-27T22:57:27.510494\",\n\t\"name\": \"water-resource-inventory-and-assessment-lower-suwannee-national-wildlife-refuge-dixie-and-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Water Resource Inventory and Assessment
  (WRIA) report for Lower Suwannee National Wildlife Refuge describes current hydrologic
  information relevant to the refuge, provides an assessment of water resource needs
  and issues of concern, and makes recommendations regarding Refuge water resources.
  This report addresses water quality and quantity for both surface water and groundwater
  resources. It also summarizes available information relevant to refuge water resources,
  provides an assessment of refuge water resource needs and issues of concern, and
  makes recommendations to address the identified water resources needs and concerns.
  Major topics addressed in this report include the natural setting of the refuge
  (topography, climate, geology, soils, hydrology), impacts of development and climate
  change, significant water resources and associated infrastructure within the refuge,
  past and current water monitoring activities on and near the refuge, water quality
  information, and state water use regulatory framework. Information was compiled
  from publicly available reports, databases, and geospatial datasets from federal,
  state, and local agencies; published research reports; websites maintained by government
  agencies, academic institutions, and non-governmental organizations; and from files
  and Geographic Information System (GIS) data layers maintained by the refuge. For
  the purposes of this assessment, the Region of Hydrologic Influence (RHI) was defined
  as the Suwannee River Basin as well as the two coastal basins encompassing the coastal
  areas north and south of the mouth of the Suwannee River. The RHI includes a total
  drainage area of 6,508,880 acres, including watersheds in Georgia and Florida. Geographic
  delineations were drawn from the National Watershed Boundary Dataset [WBD]. Specifically,
  the RHI consists of the six subbasins in the Suwannee basin (Upper Suwannee [03110201],
  Alapaha [03110202], Withlacoochee [03110203], Little [03110204], Lower Suwannee
  [03110205] and Santa Fe [03110206]); two subwatersheds in the Waccasassa subbasin
  (Wilder Creek-King Creek Frontal [031101010503] and Barnett Creek-Black Point Swamp
  Frontal [031101010504]); and 4 subwatersheds in the Econfina-Steinhatchee subbasin
  (Fishbone Creek-California Creek [031101020901], California Creek [031101020902],
  Johnson Creek-Bumblebee Creek Frontal [031101020903] and Butler Creek-Shired Creek
  Frontal [031101020906]).\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
